import { Component } from '@angular/core';

@Component({
  selector: 'app-cart',
  templateUrl: './cart.component.html',
  styleUrls: ['./cart.component.css'],
})
export class CartPanelComponent {
  constructor(public cartService: CartService) {}

  closeModal(): void {
    this.cartService.toggleCart(false);
  }
}
